import React from 'react';
import Experiences from './Experiences';

function ExperiencesWrapper() {

    return (
        <div>
            <Experiences Image="https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Facebook_f_logo_%282019%29.svg/1365px-Facebook_f_logo_%282019%29.svg.png"
                company_name="Facebook"
            date={120+"տարի"}
            />

            <Experiences Image="https://upload.wikimedia.org/wikipedia/commons/thumb/a/a5/Google_Chrome_icon_%28September_2014%29.svg/1200px-Google_Chrome_icon_%28September_2014%29.svg.png"
                company_name="Google"
                date={200} />

            <Experiences Image="https://cdn.freelogovectors.net/wp-content/uploads/2020/11/picsart-logo.png"
                company_name="Pixart"
                date={50} />
        </div>
    );
}

export default ExperiencesWrapper;
